import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import CreateArea from "./CreateArea";

function App(){
    return <div>

        <Header />
     <CreateArea />
      <Note key={1} title="Note title" content="Note content" />
      <Footer />
        <Footer />
        
    </div>
}

export default App;
